import React from "react";
import useStats from "../lib/useStats";

const StateBlock = ({ state }) => {
  console.log(state);

  return (
    <div
      style={{
        width: "40vw",
        height: "30vh",
        outline: "1px solid black",
        boxShadow: "4px 4px grey",
        boxShadow: "-4px -4px white",
      }}
    >
      {state.provinceState}
    </div>
  );
};

export default StateBlock;
